import React from 'react';
import { action } from '@storybook/addon-actions';
import { BrowserRouter } from 'react-router-dom'
import Icons from './Icons'
import ActiveLeftArrow from '../components/Icons copy/activeLeftArrow'
import ActiveRightArrow from '../components/Icons copy/activeRightArrow'
import { button } from '@material-ui/core';


export default {
  title: 'Icons',
  component: Icons
}

export function IconsContainer() {
  return (
    <BrowserRouter>
      <h4>SVG Icons</h4>
        <p><button> <ActiveRightArrow/> </button> Active Right Arrow </p>
        <p><button> <ActiveLeftArrow/> </button> Active Left Arrow </p>
    </BrowserRouter>
  )
}
